create table cars (
	id INT,
	make VARCHAR(50),
	model VARCHAR(50),
	colour VARCHAR(50),
	year VARCHAR(50),
	licence_number VARCHAR(50),
	location VARCHAR(50),
	sold_date DATE,
	bought_price VARCHAR(50),
	for_sale_price VARCHAR(50),
	sold_price VARCHAR(50),
	seller_fname VARCHAR(50),
	seller_lname VARCHAR(50),
	seller_phone VARCHAR(50),
	seller_email VARCHAR(50),
	purchaser_fname VARCHAR(50),
	purchaser_lname VARCHAR(50),
	purchaser_phone VARCHAR(50),
	purchaser_email VARCHAR(50),
	image_url VARCHAR(50)
);
